import React, { useEffect, useState } from 'react';
import { api } from '../services/api';

interface DashboardStats {
  totalUsers: number;
  activeNotifications: number;
  totalNotificationsSent: number;
  lastQueueUpdate: string;
}

const UserDashboard: React.FC = () => {
    const [stats, setStats] = useState<DashboardStats | null>(null);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState<string | null>(null);

    useEffect(() => {
        const getDashboardStats = async () => {
            try {
                setIsLoading(true);
                setError(null);

                // Fetch multiple endpoints for dashboard stats
                const [usersResponse, queueResponse] = await Promise.all([
                    api.getAllUsers(),
                    api.getCurrentQueueStatus()
                ]);

                // Calculate stats
                const dashboardData: DashboardStats = {
                    totalUsers: usersResponse.length || 0,
                    activeNotifications: usersResponse.filter((user: any) => user.isActive).length || 0,
                    totalNotificationsSent: 0, // This would come from notification logs
                    lastQueueUpdate: queueResponse?.lastUpdated || new Date().toISOString()
                };

                setStats(dashboardData);
            } catch (err: any) {
                setError('Failed to load dashboard data. Please try again later.');
                console.error('Error fetching dashboard stats:', err);
            } finally {
                setIsLoading(false);
            }
        };

        getDashboardStats();

        // Refresh stats every minute
        const interval = setInterval(getDashboardStats, 60000);
        return () => clearInterval(interval);
    }, []);

    if (isLoading) {
        return (
            <div className="container">
                <div className="card fade-in">
                    <div className="loading">
                        <div className="spinner"></div>
                    </div>
                    <p style={{ textAlign: 'center', color: 'var(--text-secondary)' }}>
                        Loading dashboard...
                    </p>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="container">
                <div className="card fade-in">
                    <div className="error-message">
                        <h2>‚ö†Ô∏è Error</h2>
                        <p>{error}</p>
                        <button 
                            className="btn btn-primary"
                            onClick={() => window.location.reload()}
                        >
                            Retry
                        </button>
                    </div>
                </div>
            </div>
        );
    }

    return (
        <div className="container">
            <div className="card fade-in">
                <div className="dashboard">
                    <div className="card-header">
                        <h1>üìä PrismaX AI Dashboard</h1>
                        <p>Monitor system statistics and queue activity</p>
                    </div>

                    <div className="dashboard-grid">
                        <div className="stat-card">
                            <span className="stat-value">{stats?.totalUsers || 0}</span>
                            <div className="stat-label">Total Registered Users</div>
                        </div>

                        <div className="stat-card">
                            <span className="stat-value">{stats?.activeNotifications || 0}</span>
                            <div className="stat-label">Active Notifications</div>
                        </div>

                        <div className="stat-card">
                            <span className="stat-value">{stats?.totalNotificationsSent || 0}</span>
                            <div className="stat-label">Total Notifications Sent</div>
                        </div>

                        <div className="stat-card">
                            <span className="stat-value">
                                {stats?.lastQueueUpdate ? 
                                    new Date(stats.lastQueueUpdate).toLocaleTimeString() : 
                                    'Unknown'
                                }
                            </span>
                            <div className="stat-label">Last Queue Update</div>
                        </div>
                    </div>

                    <div className="card" style={{ marginTop: '32px' }}>
                        <h3>System Status</h3>
                        <div style={{ display: 'flex', gap: '16px', alignItems: 'center', marginTop: '16px' }}>
                            <div className="status status-active">
                                üü¢ Queue Monitor Active
                            </div>
                            <div className="status status-active">
                                üü¢ Email Service Online
                            </div>
                            <div className="status status-active">
                                üü¢ Database Connected
                            </div>
                        </div>
                    </div>

                    <div className="card" style={{ marginTop: '24px' }}>
                        <h3>Recent Activity</h3>
                        <p style={{ color: 'var(--text-secondary)', marginTop: '16px' }}>
                            üîÑ Dashboard updates automatically every minute
                        </p>
                        <p style={{ color: 'var(--text-muted)', fontSize: '14px' }}>
                            Last updated: {new Date().toLocaleTimeString()}
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default UserDashboard;
